import { useState } from "react";

const Main = ({ darkMode, selectedFont }) => {
  const [wordData, setWordData] = useState({});
  const [error, setError] = useState(false);
  const [errorMessage, setErrorMessage] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    const searchWord = e.target.elements.search.value;

    fetch(`https://api.dictionaryapi.dev/api/v2/entries/en/${searchWord}`)
      .then(async (res) => {
        if (!res.ok) {
          throw new Error();
        }
        setError(false);
        setErrorMessage("");
        return res.json();
      })
      .then((data) => {
        setWordData(data);
      })
      .catch(() => {
        setError(true);
        setErrorMessage("No result");
      });
  };

  return (
    <div id="main-container" className={`${darkMode ? "dark-mode" : ""}`}>
      <div style={{ fontFamily: selectedFont }}>
        <form>
          <input
            type="text"
            id="search-input"
            style={{
              backgroundImage: `url(${SearchIcon})`,
              backgroundRepeat: "no-repeat",
              backgroundPosition: " 95% 50%",
              fontFamily: selectedFont, // add fontFamily style
            }}
          />
        </form>
        <div
          id="word-audio-div"
          style={{ fontFamily: selectedFont }} // add fontFamily
        >
          <div>
        <h1 id="word">{wordData.word}</h1>
            <p id="phonetic">{wordData.phonetic}</p>
          </div>
          <img id="play-icon" src={PlayIcon} alt="Play Icon" />
        </div>
        <div id="definition-div">
          <p id="definition">noun</p>
          <hr />
        </div>
        <p id="meaning">Meaning</p>
        <ul id="meanings">
          <li>
            (etc.) A set of keys used to operate a typewriter, computer etc.
          </li>
          <li>
            A component of many instruments including the piano, organ, and
            harpsichord consisting of usually black and white keys that cause
            different tones to be produced when struck.
          </li>
          <li>
            A device with keys of a musical keyboard, used to control electronic
            sound-producing devices which may be built into or separate from the
            keyboard device.
          </li>
        </ul>
        <div id="synonymos-div">
          <h3 id="synonymos">Synonyms</h3>
          <p id="synonymos-example">electronic keyboard</p>
        </div>
        <div id="definition-div">
          <p id="definition">verb</p>
          <hr />
        </div>
        <p id="meaning">Meaning</p>
        <ul id="meanings">
          <li>To type on a computer keyboard.</li>
          <li id="example">
            “Keyboarding is the part of this job I hate the most.”
          </li>
        </ul>
        <hr id="bottom-hr" />
        <div id="link-div">
          <a id="source" href="/">
            Source
          </a>
          <div id="source-div">
            <a id="link" href="/">
              https://en.wiktionary.org/wiki/keyboard
            </a>
            <img src={NewWindow} alt="New Window" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Main;
